import React, {useState, useEffect} from 'react'

const DynamicChart = ({currentPopulation}) =>{
    const [dataValues, setDynamicValues] = useState([0,0,0,0,0]);

    return(
        <div>
            {
                dataValues.map((value) =>{
                    return(
                        {value}
                    )
                })
            }
        </div>
    )
}

export default DynamicChart
